"""Harsh cleaning is applied to our dataset. Besides the usual patterns like HTMLs or Hashtags, words we with length over 12 are also removed. When cleaning a tweet is done we cut off its length to fit our wanted size. Notice that because of the this cleaning the average number of words remain in every tweet is one third of the initial, so we could keep all tweets to have length <= 30.

Removing large words and fixing tweets' length help training and predict, giving 0.5 at AUC
"""

import numpy as np

import nltk
nltk.download('wordnet')
nltk.download('stopwords')
from nltk.corpus import stopwords
from nltk.stem import WordNetLemmatizer

stop_words = set(stopwords.words('english'))

import re

import torch
import random

# from contractions import CON_MAP

def clean_text(text) :
    #Lowercase
    text = text.lower()

    #consecutive characters
    text = re.sub(r'(.)\1\1+', r'\1', text)
    
    lemmatizer = WordNetLemmatizer()
    #Contractions & Lemmatization
    text = text.split()
    
    new = []
    for word in text :
        if (len(word) > 15) :
            continue
        elif word in CON_MAP :
            new.append(CON_MAP[word])
        else:
            new.append(lemmatizer.lemmatize(word))
            new.append(word)

    text = " ".join(new)

    #HTML tags
    pat1 = r'https?:\/\/.*[\r\n]*'
    #@-mentions
    pat3 = r'(?:@[\w_]+)'
    #Hashtags
    pat4 = r'(?:\#+[\w_]+[\w\'_\-]*[\w_]+)'
    #Special characters
    pat5 = r'[_"\-;%()|+\'&=*%.,!?:#@$\[\]/]'
    #Single letters
    pat6 = r'(?<![\w\-])\w(?![\w\-])'
    #remove patterns
    combo_pat = r'|'.join((pat1, pat3, pat4, pat5, pat6))
    text = re.sub(combo_pat, '', text)

    text = text.split()
    text  = [word for word in text if not word in stop_words]

    if len(text) > 30 :
        text = text[:30]

    length = len(text)

    text = ' '.join(text)
    if (length == 0) :
        text = 'some neutral words'
        length = 3

    return text, length

def clean_data(data) :
    max_len = float('-inf')

    for i in range(len(data)) :
        data[i], length = clean_text(data[i])
        if (length > max_len) :
            max_len = length

    return data, max_len

"""Now we define the functions to use the pretrained embeddings of glove. The embeddings matrix is build manually using the glove embeddings and our datasets vocabulary."""

import numpy as np

import torch
import torch.nn as nn
import torchtext

def word_embedding() :
    words = []
    idx = 0
    word2idx = {}
    embeddings_dict = {}

    with open("glove.twitter.27B."+str(vector_size)+"d.txt", 'r', encoding="utf-8") as f:
        for l in f:
            values = l.split()
            word = values[0]
            words.append(word)
            word2idx[word] = idx
            idx += 1
            #skip the word
            vector = np.asarray(values[1:], "float32")
            embeddings_dict[word] = vector

    return embeddings_dict, word2idx


def create_emb_layer(weights_matrix) :
    num_embeddings, embedding_dim = weights_matrix.size()
    emb_layer = nn.Embedding.from_pretrained(weights_matrix)
    emb_layer.weights = nn.Parameter(weights_matrix)
    emb_layer.weight.requires_grad = False

    return emb_layer, embedding_dim

def make_weights(x, max_len) :
    embeddings_dict, w2i = word_embedding()

    weights_list = []
    target_vocab = {}
    i = 0
    words_found = 0
    for sentence in x :
        s = sentence.split()
        for word in s :
            if (word not in target_vocab) :
                target_vocab[i] = word
                try :
                    word_emb = embeddings_dict[word]
                    words_found += 1
                except KeyError :
                    word_emb = np.random.normal(scale=0.6, size=(vector_size, ))
                weights_list.append(word_emb)
                i += 1
  
    print(f'Words in Glove: {int((words_found/i)*100)}%')
    weights_matrix = np.array(weights_list)

    return weights_matrix, target_vocab

"""Having tweets we max length 10 probably does not need a data loader like this. Although, it seems that this is a more generic loader, as batches are made with tweets of the same length. With that, we can skip the padding step. In our case with max length 20, there is a some variety of lengths but using this method won't be crucial."""

def make_data_loader(text, labels, vocab) :
    word2idx = {}
    idx = 0
    for idx in range(len(vocab)) :
        word2idx[vocab[idx]] = idx
        idx += 1
  
    diff_lengths = []
    length_tweets = {}
    length_labels = {}

    for i, sentence in enumerate(text) :
        tweet = []
        words = sentence.split()
        length = len(words)

        if (length not in length_tweets) :
            length_tweets[length] = []
            length_labels[length] = []

        for word in words :
            try :
                tweet.append(word2idx[word])
            except KeyError :
                tweet.append(random.randint(1, 10000))

        length_tweets[length].append(tweet)
        if (labels[i] == 4) :
            length_labels[length].append([1])
        else :
            length_labels[length].append([0])

        if (length not in diff_lengths) :
            diff_lengths.append(length)

    batches = []
    for lenght in diff_lengths :
        if (len(length_tweets[lenght]) > max_batch_size) :
            for i in range(0, len(length_tweets[length]), max_batch_size):
                b_x = torch.LongTensor(length_tweets[length][i:i +max_batch_size])
                b_y = torch.FloatTensor(length_labels[length][i:i +max_batch_size])
                batches.append((b_x, b_y))
            continue
        b_x = torch.LongTensor(length_tweets[length])
        b_y = torch.FloatTensor(length_labels[length])
        batches.append((b_x, b_y))
            
    return batches

